import React from 'react';
import {Route, RouterProvider, createBrowserRouter, createRoutesFromElements} from 'react-router-dom';
import data from './data.json'
import {Detail_Page} from "./pages/detail_page";
import {ISubpoint} from "./models";
import './style.scss';
import {Root} from './root';
import {Location_Page} from './pages/location_page';

function App() {

    const router = createBrowserRouter(
        createRoutesFromElements(
            <Route path='/' element={<Root/>}>
                {/* eslint-disable-next-line react/jsx-pascal-case */}
                <Route index element={<Location_Page subitem={undefined}/>}></Route>
                {
                    data.map(item =>
                        <Route key={item.id} path={item.url}>
                            {
                                item.subpoint.map((subitem: ISubpoint) =>
                                    <Route key={subitem.id} path={subitem.url}
                                           element={

                                               subitem.type == "Location_Page" ? (
                                                   <Location_Page subitem={subitem}/>
                                               ) : (
                                                   <Detail_Page subitem={subitem}/>
                                               )
                                           }/>
                                )
                            }
                        </Route>
                    )
                }
            </Route>
        )
    )

    return (
        <div className="App">
            <RouterProvider router={router}/>
        </div>
    );
}

export default App;
